import React from 'react';
import { Link } from 'react-router-dom';

class HomeComponent extends React.Component {  
  render() {
    return (
      <div>
        <header>
          <img src="../../../public/favicon.ico" alt="Recycle Game"></img>
          <button>Login</button>
        </header>
        <h1>Recycle Game</h1>
        <button>Play Game</button>
      </div>
    );
  }
}

export default HomeComponent;
